Upoštevajte naslednje: deli te aplikacije so namenjeni zdravstvenim delavcem kot orodje za pomoč pri odločanju. Aplikacija ni zasnovana za bolnike in ne nadomešča nasveta zdravnika.

Mediately Register Zdravil – Mobilni pomočnik za hitrejše diagnosticiranje in boljše zdravljenje diagnostiko in zdravljenje je zdaj na voljo na vašem iPhonu in iPadu. 

Aplikacija omogoča enostavno iskanje po registru zdravil brez spletne povezave, kjer je več kot 11.000  zdravil, ter takojšen dostop do interaktivnih kliničnih orodij in kalkulatorjev odmerjanja. 

1. Pridobivanje informacij o več kot 11.000 zdravilih

Za vsako zdravilo so na voljo podrobne informacije, med njimi:

• osnovne informacije o zdravilu (učinkovina, sestava, farmacevtska oblika, razred, razvrstitev zdravil na liste ZZZS);
• pomembne informacije iz povzetka glavnih značilnosti zdravila (indikacije, odmerjanje, kontraindikacije, interakcije, neželeni učinki, preveliko odmerjanje ipd.);
• klasifikacija ATC in vzporedna zdravila;
• pakiranja in cene;
• dostop do celotnega povzetka glavnih značilnosti zdravila v PDF-obliki (potrebna je internetna povezava).

2. Iskanje po širokem naboru interaktivnih diagnostičnih orodij

Aplikacija poleg celotne baze zdravil vsebuje vrsto interaktivnih kliničnih orodij in kalkulatorjev odmerjanja, uporabnih za vašo vsakdanjo prakso:

• BMI (indeks telesne mase);
• BSA (telesna površina);
• CHA₂DS₂-VASc (rezultat tveganja za možgansko kap pri atrijski fibrilaciji);
• GCS (Glasgowska lestvica kome);
• GFR (formula MDRD);
• HAS-BLED (tveganje za večjo krvavitev pri bolnikih z AF);
• MELD (model za končno ledvično odpoved);
• PERC Score (izključitvena merila za pljučno embolijo);
• Wellsova merila za pljučno embolijo.

Poiščite orodja, ki jih vsak dan uporablja na tisoče zdravnikov. 

3. CME (Izobraževanja)

Izboljšajte svoje znanje in pridobite kreditne točke CME iz udobja lastnega doma ali ordinacije.

• Preberite članek ali si oglejte videoposnetek, ki vas zanima.
• Tematike se stalno posodabljajo in vam omogočajo koristne vpoglede v vaše strokovno področje.

Aplikacija vključuje tudi razvrstitev bolezni po MKB-10 in klasifikacijski sistem ATC. Aplikacijo redno posodabljamo, zato boste imeli vedno na voljo najnovejše informacije.

Ta aplikacija je registrirana pri Javni agenciji Republike Slovenije za zdravila in medicinske pripomočke, ki aplikacijo tudi regulira, in ima oznako CE za skladnost z zahtevami za medicinske pripomočke. Družba Modra Jagoda d.o.o. ima certifikat ISO 13485 za oblikovanje in izdelavo medicinskih pripomočkov.

